import React from 'react'
import Dice from "../Components/Dice";
import Button from 'react-bootstrap/Button'

import "./Home.scss"

const Home: React.FC<{}> = () => {

    return (
        <div className="Home">
            <Dice header={"Disc choice"} options={["Putter", "Mid", "Driver", "Understable", "Overstable", "Wild"]} />
            <Dice header={"Shot choice"} options={["Putter", "Mid", "Driver", "Understable", "Overstable", "Wild"]} />
            <Button variant="dark" size="lg" block>
                Roll dices
            </Button>
        </div>
    )
};

export default Home
